review.reviewBody:
If you want a pair of pedals that sound like they&apos;re coming apart after 2 hrs of riding by all means go for it.  Used these for two rides totaling 2.5 or so hours, 90-215W on a Stages smart bike.  For reference, pedaling on that bike &quot;feels&quot; very close to pedaling outside.  The bearings in the pedal sound like they&apos;re shot already with the pedal moving around and clicking.  Tried another pair with the same result.  Looks response to an obvious defect was: 
&quot;LOOK designs our pedals to meet and exceed ISO testing requirements. These tests are designed around an outdoor bike, or specifically a bike with a free wheel and the typical worst case conditions of that type of use vs. an indoor/stationary bike with a &quot;flywheel&quot;.&quot;

our pedals are technically not designed to be ridden on a indoor/stationary bike, which is likely the cause of the issue you are experiencing.
